Jennifer Joanne Aniston (born February 11, 1969) is an American film and television actress. Her big break came via her role as Rachel Green in the sitcom Friends. She has starred in several Hollywood films, including Bruce Almighty, Office Space, Along Came Polly, Derailed, The Break-Up and Rumor Has It.
